// === 0. KONFIGURASI PENTING (API CHROME STORAGE) ===
// ======================================================
const STORAGE_KEYS = {
    PROSES_SEMAKIN: 'ed_autofill_process_date',
    BULAN_SASARAN: 'ed_autofill_target_month',
    TAHUN_SASARAN: 'ed_autofill_target_year',
    TARIKH_CUTI: 'ed_autofill_holidays',
    // Kunci simpanan untuk input manual
    NAMA_AKTIVITI: 'ed_manual_nama',
    LOKASI: 'ed_manual_lokasi',
    KETERANGAN: 'ed_manual_keterangan',
    MASA_MULA: 'ed_manual_mula',
    MASA_TAMAT: 'ed_manual_tamat'
};

// --- FUNGSI BARU: Konfigurasi QR Code (Menggunakan Base64) ---
const QR_CODE_CONFIG = {
    // KOD BASE64 untuk imej Touch'nGOeWallet.jpg anda
    // Ini memastikan imej dipaparkan tanpa memuat naik ke pelayan luar.
    IMAGE_URL: 'data:image/png;base64,',
    ALT_TEXT: 'QR Code DuitNow Touch n Go eWallet Ahmad Fahmie'
};
