// --- Fungsi Pengganti GM_ (Menggunakan Chrome Storage API) ---
function storageGet(key, defaultValue) {
    return new Promise((resolve) => {
        chrome.storage.local.get([key], (result) => {
            if (chrome.runtime.lastError) {
                console.error("Storage get error:", chrome.runtime.lastError);
                resolve(defaultValue);
            } else {
                resolve(result[key] === undefined ? defaultValue : result[key]);
            }
        });
    });
}

function storageSet(key, value) {
    return new Promise((resolve) => {
        chrome.storage.local.set({ [key]: value }, () => {
            if (chrome.runtime.lastError) {
                console.error("Storage set error:", chrome.runtime.lastError);
            }
            resolve();
        });
    });
}

function storageDelete(key) {
    return new Promise((resolve) => {
        chrome.storage.local.remove(key, () => {
            if (chrome.runtime.lastError) {
                console.error("Storage remove error:", chrome.runtime.lastError);
            }
            resolve();
        });
    });
}

function tambahStyle(css) {
    const style = document.createElement('style');
    style.type = 'text/css';
    style.innerHTML = css;
    document.head.appendChild(style);
}

// ======================================================
// === 0.5. FUNGSI SEMAKAN DAN REDIRECT (di /aktiviti/papar/*) ===
// ======================================================
(async function() {
    'use strict';
    // Hanya berjalan di laman '/aktiviti/papar/*'
    if (window.location.pathname.match(/^\/aktiviti\/papar\//i)) {
        const progressDay = await storageGet(STORAGE_KEYS.PROSES_SEMAKIN, 0);

        if (progressDay > 0) {
            const targetUrl = 'https://ediary.sprm.gov.my/aktiviti/tambah';
            console.log(`🚀 Redirect: Berjaya Hantar. Mengalih ke ${targetUrl} untuk hari seterusnya...`);
            window.location.replace(targetUrl);
            return;
        }
    }
})();

// ======================================================
// === 1. SKRIP UTAMA (Berjalan di '/aktiviti/tambah') ===
// ======================================================
(function() {
    'use strict';

    // --- SEMAK KEBERGANTUNGAN KRITIKAL ---
    if (typeof jQuery === 'undefined' || typeof $ === 'undefined') {
        if (window.location.pathname.match(/^\/aktiviti\/tambah/i)) {
            console.error('❌ jQuery tidak ditemui. Skrip tidak dapat berjalan.');
        }
        return;
    }

    // ======================================================
    // === 1. KONFIGURASI JAWAPAN TEMPLATE ===
    // ======================================================
    const JAWAPAN_DEFAULT = {
        NAMA_AKTIVITI: "Nama Aktiviti",
        KETERANGAN: "",
        LOKASI: "Pejabat",

        KATEGORI_VALUE: "1",
        KEBENARAN_VALUE: "3",
        MASA_MULA: '08:00 AM',
        MASA_TAMAT: '04:30 PM',
    };

    // ======================================================
    // === 2. KONFIGURASI TEKNIKAL ===
    // ======================================================
    const SELECTOR = {
        NAMA_AKTIVITI: '#tactivity-title',
        KATEGORI: '#tactivity-activity',
        LOKASI: '#tactivity-location',
        KEBENARAN: '#tactivity-permission_type',
        KETERANGAN_CKEDITOR_ID: 'tactivity-detail',
        INPUT_MASA_MULA: '#tactivity-date_from',
        INPUT_MASA_TAMAT: '#tactivity-date_to',
        TOMBOL_HANTAR: 'button[type="submit"]',
        FORM_ID: '#add-activity-form',

        MODAL_CONFIRM_YES_BUTTON: '#submit', // Butang Pengesahan dalam modal
    };

    const DELAY_MILISEKONDS = 2000;

    let clickAttempted = false;
    let checkInterval = null;


    // --- FUNGSI UTILITY ---
    function getDatePart(dateObj) {
        const dd = String(dateObj.getDate()).padStart(2, '0');
        const mm = String(dateObj.getMonth() + 1).padStart(2, '0');
        const yyyy = dateObj.getFullYear();
        return `${dd}/${mm}/${yyyy}`;
    }

    function getDaysInMonth(year, month) {
        return new Date(year, month, 0).getDate();
    }


    // --- FUNGSI AUTO-KLIK MODAL BOX (AGRESIF) ---
    function autoKlikPengesahan() {
        if (checkInterval) {
            clearInterval(checkInterval);
            checkInterval = null;
        }

        checkInterval = setInterval(() => {
            const confirmButton = $('.modal.in').find(SELECTOR.MODAL_CONFIRM_YES_BUTTON);
            const alternativeButton = $('.modal.in button:contains("Ya")');

            if (confirmButton.length && !clickAttempted) {

                clickAttempted = true;
                clearInterval(checkInterval);
                checkInterval = null;

                console.log("✅ Modal Pengesahan Dikesan. Mencuba klik agresif.");

                setTimeout(() => {
                    const btnNative = confirmButton[0];

                    if (btnNative) {
                        btnNative.click();
                        confirmButton.trigger('click');
                        const keyPressEvent = $.Event('keypress', { which: 13 });
                        $(document).trigger(keyPressEvent);
                        btnNative.dispatchEvent(new MouseEvent('mousedown', { bubbles: true }));
                        btnNative.dispatchEvent(new MouseEvent('mouseup', { bubbles: true }));
                        btnNative.dispatchEvent(new MouseEvent('click', { bubbles: true }));

                        console.log("✅ Semua kaedah klik/keypress telah dicuba. Menunggu pengalihan halaman...");
                    } else if (alternativeButton.length) {
                        alternativeButton.click();
                        console.log("✅ Butang 'Ya' Alternatif Ditemui & Diklik.");
                    } else {
                        console.warn("⚠️ Butang pengesahan wujud tetapi elemen native hilang.");
                    }

                }, 300);
            } else if (clickAttempted) {
                clearInterval(checkInterval);
                checkInterval = null;
            }
        }, 200);
    }

    function startModalObserver() {
        console.log("Memulakan Pemeriksaan Klik Modal Agresif.");
        clickAttempted = false;
        autoKlikPengesahan();
    }


    // --- FUNGSI UTAMA ISI BORANG ---

    async function isiBorang(tarikhObj) {
        const namaAktiviti = await storageGet(STORAGE_KEYS.NAMA_AKTIVITI, JAWAPAN_DEFAULT.NAMA_AKTIVITI);
        const lokasi = await storageGet(STORAGE_KEYS.LOKASI, JAWAPAN_DEFAULT.LOKASI);
        const keterangan = await storageGet(STORAGE_KEYS.KETERANGAN, JAWAPAN_DEFAULT.KETERANGAN);
        const masaMulaInput = await storageGet(STORAGE_KEYS.MASA_MULA, JAWAPAN_DEFAULT.MASA_MULA);
        const masaTamatInput = await storageGet(STORAGE_KEYS.MASA_TAMAT, JAWAPAN_DEFAULT.MASA_TAMAT);

        if (!namaAktiviti || !masaMulaInput || !masaTamatInput) {
            alert('❌ Sila pastikan anda mengisi Nama Aktiviti, Masa Mula dan Masa Tamat di GUI.');
            return false;
        }

        const datePart = getDatePart(tarikhObj);
        const masaMulaFormatted = `${datePart} ${masaMulaInput}`;
        const masaTamatFormatted = `${datePart} ${masaTamatInput}`;

        const elAktiviti = $(SELECTOR.NAMA_AKTIVITI);
        const elLokasi = $(SELECTOR.LOKASI);
        const elKategori = $(SELECTOR.KATEGORI);
        const elKebenaran = $(SELECTOR.KEBENARAN);
        const elMasaMula = $(SELECTOR.INPUT_MASA_MULA);
        const elMasaTamat = $(SELECTOR.INPUT_MASA_TAMAT);

        elAktiviti.val(namaAktiviti);
        elLokasi.val(lokasi);
        elKategori.val(JAWAPAN_DEFAULT.KATEGORI_VALUE);
        elKebenaran.val(JAWAPAN_DEFAULT.KEBENARAN_VALUE);
        elMasaMula.val(masaMulaFormatted);
        elMasaTamat.val(masaTamatFormatted);

        if (typeof CKEDITOR !== 'undefined' && CKEDITOR.instances[SELECTOR.KETERANGAN_CKEDITOR_ID]) {
            CKEDITOR.instances[SELECTOR.KETERANGAN_CKEDITOR_ID].setData(keterangan);
            CKEDITOR.instances[SELECTOR.KETERANGAN_CKEDITOR_ID].updateElement();
        } else {
            $(`#${SELECTOR.KETERANGAN_CKEDITOR_ID}`).val(keterangan);
        }

        elAktiviti.trigger('change');
        elLokasi.trigger('change');
        elKategori.trigger('change');
        elKebenaran.trigger('change');
        elMasaMula.trigger('change');
        elMasaTamat.trigger('change');

        // PENTING: PENGUBAHSUAIAN UNTUK MEMAKSA YII MENGESAHKAN BORANG
        if (typeof jQuery.fn.yiiActiveForm !== 'undefined') {
            const yiiForm = $(SELECTOR.FORM_ID).data('yiiActiveForm');
            if (yiiForm) {
                $.each(yiiForm.attributes, function() {
                    this.status = 3;
                });
                $(SELECTOR.FORM_ID).yiiActiveForm('validate');
            }
        }
        return true;
    }

    function hantarBorang() {
        const elHantar = $(SELECTOR.TOMBOL_HANTAR);
        if (elHantar.length) {

            if (typeof jQuery.fn.yiiActiveForm !== 'undefined') {
                 $(SELECTOR.FORM_ID).yiiActiveForm('submitForm');

                 setTimeout(() => {
                     if (elHantar.length) elHantar.click();
                 }, 500);
            } else {
                 elHantar.click();
            }
            return true;
        }
        return false;
    }

    async function prosesBulan() {
        const targetMonth = parseInt(await storageGet(STORAGE_KEYS.BULAN_SASARAN));
        const targetYear = parseInt(await storageGet(STORAGE_KEYS.TAHUN_SASARAN));
        let currentDay = await storageGet(STORAGE_KEYS.PROSES_SEMAKIN, 1);
        const holidayStr = await storageGet(STORAGE_KEYS.TARIKH_CUTI, "");

        if (isNaN(targetMonth) || isNaN(targetYear)) {
            console.warn('❌ Gagal mendapatkan Bulan atau Tahun Sasaran. Sila pastikan nilai disimpan di GUI.');
            return;
        }

        const hariCuti = holidayStr.split(',').map(d => d.trim()).filter(Boolean);

        const daysInMonth = getDaysInMonth(targetYear, targetMonth);

        for (let day = currentDay; day <= daysInMonth; day++) {
            const currentDate = new Date(targetYear, targetMonth - 1, day);
            const dayOfWeek = currentDate.getDay();
            const dateFormattedDDMM = `${String(day).padStart(2, '0')}/${String(targetMonth).padStart(2, '0')}`;

            let isHoliday = false;

            // 1. Skip Hujung Minggu (Sabtu=6, Ahad=0)
            if (dayOfWeek === 0 || dayOfWeek === 6) {
                isHoliday = true;
            }

            // 2. Skip Hari Cuti (Input Manual Sahaja dari GUI)
            if (hariCuti.includes(dateFormattedDDMM)) {
                isHoliday = true;
                console.log(`SKIP: ${dateFormattedDDMM} adalah hari cuti (Input Manual).`);
            }

            if (isHoliday) {
                if (day < daysInMonth) {
                    await storageSet(STORAGE_KEYS.PROSES_SEMAKIN, day + 1);
                } else {
                    await storageSet(STORAGE_KEYS.PROSES_SEMAKIN, daysInMonth + 1);
                }
                continue;
            }

            // --- PROSES HARI BEKERJA/ISI BORANG ---

            if (day < daysInMonth) {
                await storageSet(STORAGE_KEYS.PROSES_SEMAKIN, day + 1);
            } else {
                await storageSet(STORAGE_KEYS.PROSES_SEMAKIN, daysInMonth + 1);
            }

            console.log(`⏳ Memproses tarikh: ${dateFormattedDDMM}. Hari seterusnya: ${day + 1}`);


            if (await isiBorang(currentDate)) {
                await new Promise(r => setTimeout(r, DELAY_MILISEKONDS));

                if (hantarBorang()) {
                    console.log(`✅ Hantar Hari ${day} Berjaya. Menunggu Modal Pengesahan untuk Auto-klik dan Redirect...`);
                    return;
                }
            }
        }

        // --- SKRIP SELESAI ---
        await storageDelete(STORAGE_KEYS.PROSES_SEMAKIN);
        await storageDelete(STORAGE_KEYS.NAMA_AKTIVITI);
        await storageDelete(STORAGE_KEYS.LOKASI);
        await storageDelete(STORAGE_KEYS.KETERANGAN);
        await storageDelete(STORAGE_KEYS.MASA_MULA);
        await storageDelete(STORAGE_KEYS.MASA_TAMAT);
        await storageDelete(STORAGE_KEYS.TARIKH_CUTI);

        alert(`🎉 Selesai! Semua aktiviti untuk bulan ${targetMonth}/${targetYear} telah dihantar.`);
        if (document.getElementById('status')) {
            document.getElementById('status').innerText = 'Status: Selesai';
        }
    }

    // --- FUNGSI POPUP QR CODE (DIPULIHKAN DENGAN BASE64) ---
    function createQRCodePopup() {
        const popupHTML = `
            <div id="qrcode-popup-overlay">
                <div id="qrcode-popup-content">
                    <button id="qrcode-popup-close">X</button>
                    <img src="data:image/png;base64,">
                    <img src="${QR_CODE_CONFIG.IMAGE_URL}" alt="${QR_CODE_CONFIG.ALT_TEXT}" id="qrcode-image">			
                    <p>Scan with any of your banking apps or eWallets to transfer money or pay.</p>
                </div>
            </div>
        `;

        // Tambah HTML ke body
        $('body').append(popupHTML);

        // Tambah CSS
        tambahStyle(`
            #qrcode-popup-overlay {
                position: fixed; top: 0; left: 0; width: 100%; height: 100%;
                background: rgba(0, 0, 0, 0.7); z-index: 100000;
                display: none; /* Sembunyikan secara lalai */
                justify-content: center; align-items: center;
                opacity: 0; /* Untuk transisi */
                transition: opacity 0.2s ease-in-out;
            }
            #qrcode-popup-overlay.active {
                display: flex !important; /* Paksa display flex */
                opacity: 1 !important; /* Paksa opacity 1 */
            }
            #qrcode-popup-content {
                background: white; padding: 25px; border-radius: 10px;
                box-shadow: 0 5px 15px rgba(0, 0, 0, 0.5);
                text-align: center; position: relative;
                width: 300px; max-width: 90%;
            }
            #qrcode-popup-close {
                position: absolute; top: 10px; right: 10px;
                background: #f44336; color: white; border: none;
                border-radius: 50%; width: 28px; height: 28px;
                cursor: pointer; font-size: 16px; line-height: 1;
                padding: 0;
            }
            #qrcode-popup-content h4 {
                color: #3c8dbc; margin-top: 0; margin-bottom: 15px;
            }
            #qrcode-image {
                width: 200px; height: 200px; max-width: 100%;
                border: 2px solid #ccc; border-radius: 5px;
                margin-bottom: 15px;
            }
            #qrcode-popup-content p {
                font-size: 12px; color: #555;
            }
        `);

        // Event Listener untuk butang tutup
        $('#qrcode-popup-close, #qrcode-popup-overlay').on('click', function(e) {
            if (e.target.id === 'qrcode-popup-close' || e.target.id === 'qrcode-popup-overlay') {
                const $overlay = $('#qrcode-popup-overlay');
                $overlay.removeClass('active');
                setTimeout(() => {
                    $overlay.css('display', 'none');
                }, 200); // 200ms sepadan dengan transisi opacity
            }
        });

        // Hentikan penutupan apabila klik dalam kandungan popup
        $('#qrcode-popup-content').on('click', function(e) {
            e.stopPropagation();
        });
    }

    // --- GUI ---

    async function initGUI() {
        const currentMonth = new Date().getMonth() + 1;
        const currentYear = new Date().getFullYear();
        const savedMonth = await storageGet(STORAGE_KEYS.BULAN_SASARAN, currentMonth);
        const savedYear = await storageGet(STORAGE_KEYS.TAHUN_SASARAN, currentYear);
        const savedHolidays = await storageGet(STORAGE_KEYS.TARIKH_CUTI, '');
        const currentProgressDay = await storageGet(STORAGE_KEYS.PROSES_SEMAKIN, 0);

        const savedNama = await storageGet(STORAGE_KEYS.NAMA_AKTIVITI, JAWAPAN_DEFAULT.NAMA_AKTIVITI);
        const savedLokasi = await storageGet(STORAGE_KEYS.LOKASI, JAWAPAN_DEFAULT.LOKASI);
        const savedKeterangan = await storageGet(STORAGE_KEYS.KETERANGAN, JAWAPAN_DEFAULT.KETERANGAN);
        const savedMula = await storageGet(STORAGE_KEYS.MASA_MULA, JAWAPAN_DEFAULT.MASA_MULA);
        const savedTamat = await storageGet(STORAGE_KEYS.MASA_TAMAT, JAWAPAN_DEFAULT.MASA_TAMAT);

        let statusText;
        if (currentProgressDay > 0) {
            statusText = `Berjalan: ${savedMonth}/${savedYear} (Hari ${currentProgressDay})`;
        } else {
            statusText = 'Sedia';
        }

        tambahStyle(`
            #autofill-container {
                position: fixed; top: 10px; right: 10px; z-index: 99999;
                background: #f9f9f9; border: 2px solid #3c8dbc; padding: 12px;
                box-shadow: 0 4px 8px rgba(0,0,0,0.1); border-radius: 8px;
                font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif; font-size: 13px;
                width: 380px;
            }
            #autofill-container button { margin-top: 8px; padding: 8px; cursor: pointer; border-radius: 4px; border: none; width: 100%; font-weight: bold; }
            #autofill-container input:not([type="time"]):not([type="number"]), #autofill-container textarea {
                width: 100%; margin-bottom: 5px; padding: 6px; box-sizing: border-box; border: 1px solid #ccc; border-radius: 3px;
            }
            #autofill-container .input-group { display: flex; gap: 10px; }
            #autofill-container .input-group input { flex-grow: 1; }

            #autofill-container label { display: block; margin-top: 8px; font-weight: 600; color: #333; }
            #autofill-container h4 { margin-top: 0; margin-bottom: 10px; color: #3c8dbc; border-bottom: 1px solid #eee; padding-bottom: 5px;}
            #status { margin-bottom: 10px; padding: 8px; background: ${currentProgressDay > 0 ? '#ffdddd' : '#eeffdd'}; border: 1px solid ${currentProgressDay > 0 ? '#f44336' : '#4CAF50'}; border-radius: 3px; text-align: center; font-weight: bold; }
            #btn-bmc { background-color: #FFDD00; color: #333; margin-top: 10px; font-size: 14px; border: 1px solid #AA9900;}
        `);

        const container = document.createElement('div');
        container.id = 'autofill-container';
        container.innerHTML = `
            <h4>⚙️ AutoFill e-Diary Bulanan</h4>
            <div id="status">${statusText}</div>

            <label>Nama Aktiviti:</label>
            <input type="text" id="nama_aktiviti" value="${savedNama}">

            <label>Lokasi:</label>
            <input type="text" id="lokasi" value="${savedLokasi}">

            <label>Keterangan / Rujukan Fail:</label>
            <textarea id="keterangan" rows="3">${savedKeterangan}</textarea>

            <label>Tarikh/Masa (Sesi Tunggal):</label>
            <div class="input-group">
                <input type="time" id="masa_mula" value="${savedMula.replace(' AM', '').replace(' PM', '')}">
                <input type="time" id="masa_tamat" value="${savedTamat.replace(' AM', '').replace(' PM', '')}">
            </div>

            <hr style="border-top: 1px solid #eee; margin: 10px 0;">

            <label>Bulan Sasaran (1-12):</label>
            <input type="number" id="bulan" min="1" max="12" value="${savedMonth}">

            <label>Tahun Sasaran:</label>
            <input type="number" id="tahun" min="2020" max="2030" value="${savedYear}">

            <label>Tarikh Cuti (DD/MM, DD/MM):</label>
            <input type="text" id="cuti" placeholder="Cuti Umum/Negeri/Ganti (cth: 15/10, 24/10)" value="${savedHolidays}">

            <button id="btn-mula" style="background-color: #4CAF50; color: white;">${currentProgressDay > 0 ? 'SAMBUNG AUTOFILL' : 'MULA AUTOFILL'}</button>
            <button id="btn-reset" style="background-color: #f44336; color: white;">RESET SEMUA STATUS</button>

            <hr style="border-top: 1px solid #eee; margin: 15px 0 10px 0;">
            <p style="font-size: 11px; color: #555; text-align: justify; line-height: 1.4;">
                Jika tool ini memberikan manfaat kepada anda, belanja saya kopi sebagai tanda terima kasih.
            </p>

            <button id="btn-bmc">☕ Belanja kopi</button>
        `;

        document.body.appendChild(container);

        // Panggil fungsi untuk cipta popup
        createQRCodePopup();

        // --- Event Listeners untuk Simpan Nilai Baru ---
        document.getElementById('nama_aktiviti').addEventListener('change', async (e) => await storageSet(STORAGE_KEYS.NAMA_AKTIVITI, e.target.value));
        document.getElementById('lokasi').addEventListener('change', async (e) => await storageSet(STORAGE_KEYS.LOKASI, e.target.value));
        document.getElementById('keterangan').addEventListener('change', async (e) => await storageSet(STORAGE_KEYS.KETERANGAN, e.target.value));
        document.getElementById('masa_mula').addEventListener('change', async (e) => await storageSet(STORAGE_KEYS.MASA_MULA, formatTime(e.target.value)));
        document.getElementById('masa_tamat').addEventListener('change', async (e) => await storageSet(STORAGE_KEYS.MASA_TAMAT, formatTime(e.target.value)));

        document.getElementById('bulan').addEventListener('change', async (e) => await storageSet(STORAGE_KEYS.BULAN_SASARAN, parseInt(e.target.value)));
        document.getElementById('tahun').addEventListener('change', async (e) => await storageSet(STORAGE_KEYS.TAHUN_SASARAN, parseInt(e.target.value)));
        document.getElementById('cuti').addEventListener('change', async (e) => await storageSet(STORAGE_KEYS.TARIKH_CUTI, e.target.value.trim().replace(/\s/g, '')));

        function formatTime(time24) {
            const [hours, minutes] = time24.split(':').map(Number);
            const period = hours >= 12 ? 'PM' : 'AM';
            const hours12 = hours % 12 || 12;
            return `${String(hours12).padStart(2, '0')}:${String(minutes).padStart(2, '0')} ${period}`;
        }

        // --- AUTO-START / RESUME LOGIC YANG DIPERBAIKI ---
        if (currentProgressDay > 0) {
              setTimeout(prosesBulan, 500);
        }
        // --- AKHIR LOGIK AUTO-START ---

        document.getElementById('btn-mula').addEventListener('click', async () => {
              const targetMonth = parseInt(document.getElementById('bulan').value);
              const targetYear = parseInt(document.getElementById('tahun').value);
              const nama = document.getElementById('nama_aktiviti').value;
              const mula = document.getElementById('masa_mula').value;
              const tamat = document.getElementById('masa_tamat').value;

              if (!nama || !mula || !tamat) {
                  alert('❌ Sila isi Nama Aktiviti, Masa Mula dan Masa Tamat sebelum memulakan AutoFill.');
                  return;
              }

              await storageSet(STORAGE_KEYS.NAMA_AKTIVITI, nama);
              await storageSet(STORAGE_KEYS.LOKASI, document.getElementById('lokasi').value);
              await storageSet(STORAGE_KEYS.KETERANGAN, document.getElementById('keterangan').value);
              await storageSet(STORAGE_KEYS.MASA_MULA, formatTime(mula));
              await storageSet(STORAGE_KEYS.MASA_TAMAT, formatTime(tamat));
              await storageSet(STORAGE_KEYS.BULAN_SASARAN, targetMonth);
              await storageSet(STORAGE_KEYS.TAHUN_SASARAN, targetYear);
              await storageSet(STORAGE_KEYS.TARIKH_CUTI, document.getElementById('cuti').value.trim().replace(/\s/g, ''));

              const startDay = currentProgressDay > 0 ? currentProgressDay : 1;
              const action = currentProgressDay > 0 ? 'Sambung' : 'Mulakan';

              if (confirm(`Anda pasti untuk ${action} AutoFill bagi bulan ${targetMonth}/${targetYear} bermula Hari ${startDay}?`)) {
                  if (currentProgressDay === 0) {
                      await storageSet(STORAGE_KEYS.PROSES_SEMAKIN, 1);
                  }
                  window.location.reload();
              }
        });

        document.getElementById('btn-reset').addEventListener('click', async () => {
              if (confirm('Anda pasti ingin menetapkan semula SEMUA status, termasuk data input manual? Ini akan memulakan dari Hari 1.')) {
                  await storageDelete(STORAGE_KEYS.PROSES_SEMAKIN);
                  await storageDelete(STORAGE_KEYS.TARIKH_CUTI);
                  await storageDelete(STORAGE_KEYS.NAMA_AKTIVITI);
                  await storageDelete(STORAGE_KEYS.LOKASI);
                  await storageDelete(STORAGE_KEYS.KETERANGAN);
                  await storageDelete(STORAGE_KEYS.MASA_MULA);
                  await storageDelete(STORAGE_KEYS.MASA_TAMAT);

                  document.getElementById('status').innerText = 'Status: Sedia';
                  window.location.reload();
              }
        });

        // --- Event Listener untuk Sumbangan (Belanja Saya Kopi) - KINI POPUP ---
        document.getElementById('btn-bmc').addEventListener('click', () => {
             // Paksa display: flex, kemudian tambah kelas 'active' untuk transisi opacity
             const $overlay = $('#qrcode-popup-overlay');
             $overlay.css('display', 'flex');
             setTimeout(() => {
                 $overlay.addClass('active');
             }, 10);
        });
    }


    // --- INIT (Hanya berjalan di /aktiviti/tambah) ---
    if (window.location.pathname.match(/^\/aktiviti\/tambah/i)) {
      $(document).ready(async () => {
          await initGUI();
          const currentProgressDay = await storageGet(STORAGE_KEYS.PROSES_SEMAKIN, 0);

          if (currentProgressDay > 0) {
              startModalObserver();
          }
      });
    }

})(); // Tutup skrip utama